import React, { Component } from 'react';
import './App.css';
import Results from './Results';
import axios from 'axios';

class App extends Component {
    constructor (props) {
        super(props);
        this.state = {
            videoId: null
        }
    }

    searchHandler() {
        axios
            .get(
                'https://www.googleapis.com/youtube/v3/search?part=snippet&key=AIzaSyDeMhcfA8lM8PGnMAkPl2n76hog-lAzgxc&type=video&q=ajax'
            )
            .then((response) => {
                console.log(response);
            })
            .catch((err) => console.log(err));
    }

    render () {
        return (
            <div>
                <header>
                    <p>YouTube Demo</p>
                    <input></input>
                    <button onClick={() => this.searchHandler()}>Search</button>
                </header>
                <div className="App">
                    <YouTubeComp />
                    <Results />
                </div>
            </div>
        );
    }
}

export default App;
